import React from 'react';
import Tab, { ITabProps } from './tab';
import { StyledTabs, TabsNav } from './styles';

export interface ITabsProps {
  tabs: ITabProps[];
};

const Tabs: React.FC<ITabsProps> = ({ tabs }) => {
  return (
    <StyledTabs>
      <h2 className='visually-hidden'>Сервисы</h2>
      <TabsNav>
        {tabs.map((tab) => (
          <li key={tab.id}>
            {tab.title}
          </li>
        ))}
      </TabsNav>
      <Tab
        id={tabs[1].id}
        title={tabs[1].title}
        text={tabs[1].text}
        icon={tabs[1].icon}
      />
    </StyledTabs>
  )
};

export default Tabs;
